$_MODULE['<{dhldp}prestashop>additional-services_5024792a18cdfb56192bb2c330f58998'] = 'Visuelle Altersprüfung';
$_MODULE['<{dhldp}prestashop>additional-services_906677e30532fc7ac5cef3907a5fbe29'] = 'Mit diesem Service können Sie auf eine unkomplizierte und bequeme Weise bestimmen, dass Ihre Artikel nicht an Kinder oder Minderjährige übergeben werden. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_c088667b7aa7d1f3a65d0c01e579d61e'] = 'Nachnahme';
$_MODULE['<{dhldp}prestashop>additional-services_fd5ff032774ec5178bfd6dff53af6158'] = 'Sicherheit vor allem in Bezug auf Kunden, die ihre erste Bestellung tätigen und Diskretion der Zahlungsabwicklung - wird die Transaktion nicht in den Bankkonto-Auszügen des Empfängers erscheinen - aktiviert durch zuverlässige Zahlung während der Paketübergabe. Es können zusätzliche Kosten entstehen.';
$_MODULE['<{dhldp}prestashop>additional-services_f59f9458cffc4a068e74c2d6d1c7cabb'] = 'Nachnahme: Gebühr';
$_MODULE['<{dhldp}prestashop>additional-services_e7d9561d18477b3f5b1f6ae4053e2fac'] = 'Nachnahme: Betrag';
$_MODULE['<{dhldp}prestashop>additional-services_2acae8be44a70913481e66dd2cd3f761'] = 'Euro';
$_MODULE['<{dhldp}prestashop>additional-services_71df513c82f72d943b69da52a6a3fec0'] = 'Zusatzversicherung';
$_MODULE['<{dhldp}prestashop>additional-services_5a391bf53e08dab90b4483ad279798ea'] = 'Die Dienstleistung sieht vor, dass Ihre Pakete geschützt sind, auch wenn sie die Haftungsgrenze von 500 EUR überschreiten. Die Zusatzversicherung bietet Ihnen bis zu 2.500 EUR (Zusatzversicherung A) oder 25.000 EUR (Zusatzversicherung B) ausreichend Schutz. Daher können Sie finanziellen Verlust oder Beschädigung zu vermeiden. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_19c04ea76ddf769892f77e0ca2eaee95'] = 'Zusatzversicherung: Betrag';
$_MODULE['<{dhldp}prestashop>additional-services_635ddcc3076ffc18dbbf6cf2b480153a'] = 'Sperrgut';
$_MODULE['<{dhldp}prestashop>additional-services_0c2868718eaf308ec1de9c2407e3ee97'] = 'Identitätsprüfung';
$_MODULE['<{dhldp}prestashop>additional-services_d330fbc3e99b54b48721e0becae5d714'] = 'Mit diesem Dienst legen Sie fest, dass Ihre Sendungen erst nach der Identitätsprüfung persönlich an den Empfänger ausgeliefert werden darf und ggf. das Alter mit dem Personalausweis überprüft wird. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_9a84a0bf573688bd67338fbd183e4660'] = 'Prüfung: Nachname';
$_MODULE['<{dhldp}prestashop>additional-services_2091538d75e2ff1e24fb3544fb33cc4c'] = 'Prüfung: Vorname';
