$_MODULE['<{dhldp}prestashop>additional-services_8aa8ec333a8b931914f00358b3cd065e'] = 'Prüfung: Mindestalter';
$_MODULE['<{dhldp}prestashop>additional-services_4dcc356f1151a8f4f7c10c3df1654479'] = 'GoGreen';
$_MODULE['<{dhldp}prestashop>additional-services_61a8bcdc7c3a6d36f119320a9992a54b'] = 'Sie tragen zu einem nachhaltigen Klimaschutz bei, indem sie die CO2-Emissionen ausgleichen, die während des Transports Ihrer Gegenstände entstehen. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_aacf5cb67b03143d7595ab51df3f2330'] = 'leicht verderbliche Waren';
$_MODULE['<{dhldp}prestashop>additional-services_d6337ca12acf5b4376007b5122618773'] = 'Persönliche';
$_MODULE['<{dhldp}prestashop>additional-services_549f859ff5e8092c57c763663211db6d'] = 'Keine Lieferung an Nachbar';
$_MODULE['<{dhldp}prestashop>additional-services_35d721466b2b8b24784003e4966de438'] = 'Mit diesem Service können Sie eine alternative Lieferung an den Nachbarn ausschließen, falls der Empfänger während der Lieferung nicht verfügbar ist. Sie tragen zu einem nachhaltigen Klimaschutz bei, indem sie die CO2-Emissionen ausgleichen, die während des Transports Ihrer Gegenstände entstehen. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_1af1cd5fa6071820ac6ca9ee3478d27f'] = 'Nur benannte Person';
$_MODULE['<{dhldp}prestashop>additional-services_c981423408803f37b32573a3a7970467'] = 'Mit diesem Service legen Sie fest, dass Ihre Pakete ausschließlich dem Empfänger persönlich oder einer autorisierten Person zugestellt werden. Sie tragen zu einem nachhaltigen Klimaschutz bei, indem sie die CO2-Emissionen ausgleichen, die während des Transports Ihrer Gegenstände entstehen. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_9b77be1f624c2a1caf0f0eaf81eb2bec'] = 'Rückschein';
$_MODULE['<{dhldp}prestashop>additional-services_8d5e7e72f12067991186cdf3cb7d5d9d'] = 'Premium';
$_MODULE['<{dhldp}prestashop>additional-services_61440699a12c1591433c374c0e9def83'] = 'Bevorzugter Standort';
$_MODULE['<{dhldp}prestashop>additional-services_43395aee4e58bb5480ea4d7c2ee64aba'] = 'Mit dieser Adressierungsversion können Ihre Kunden Pakete rund um die Uhr empfangen, auch wenn niemand zu Hause ist. Ohne Extrakosten.';
$_MODULE['<{dhldp}prestashop>additional-services_33a3a8cc8090b6ef417fa283ad904f35'] = 'Bevorzugter Nachbar';
$_MODULE['<{dhldp}prestashop>additional-services_d862b092d3b9226809ed1908573fbe64'] = 'Ist der Kunde am Liefertag nicht zu Hause, werden die Pakete bei dem bevorzugten Nachbarn gelassen. Ohne Extrakosten.';
$_MODULE['<{dhldp}prestashop>additional-services_c4088d33fd3c0d1289fa18a3dd99a0b3'] = 'Bevorzugter Tag';
$_MODULE['<{dhldp}prestashop>additional-services_78059097cf9dd1cbcd02901cec214b8a'] = 'Ihr Paket wird am gewünschten Tag, den Sie im Voraus angegeben haben, geliefert. Zusätzliche Zahlung zum Preis eines Paketes.';
$_MODULE['<{dhldp}prestashop>additional-services_e756c3a9ddd348e2d993de47df2f443d'] = 'Bevorzugter Zeit';
$_MODULE['<{dhldp}prestashop>additional-services_28da51aabf2fb54e5c4c648fb385bb02'] = 'Mit der gewünschten Servicezeit können Ihre Kunden eines des zwei-Stunden-Zeitrahmens für die Lieferung Ihrer Artikel auswählen - bundesweit in Deutschland. Zusätzliche Zahlung zum Preis eines Paketes.';
